<?phpnamespace Nemundo\Meteo\MeteoschweizAllgemeineLage\Install;use Nemundo\App\Application\Type\Install\AbstractUninstall;use Nemundo\App\Scheduler\Setup\SchedulerSetup;use Nemundo\Content\Setup\ContentTypeSetup;use Nemundo\Meteo\MeteoschweizAllgemeineLage\Application\MeteoschweizAllgemeineLageApplication;use Nemundo\Meteo\MeteoschweizAllgemeineLage\Content\AllgemeineLage\AllgemeineLageContentType;use Nemundo\Meteo\MeteoschweizAllgemeineLage\Content\LatestAllgemeineLage\LatestAllgemeineLageContentType;use Nemundo\Meteo\MeteoschweizAllgemeineLage\Data\MeteoschweizAllgemeineLageModelCollection;use Nemundo\Meteo\MeteoschweizAllgemeineLage\Scheduler\AllgemeineLageScheduler;use Nemundo\Model\Setup\ModelCollectionSetup;class MeteoschweizAllgemeineLageUninstall extends AbstractUninstall{    public function uninstall()    {        (new ContentTypeSetup(new MeteoschweizAllgemeineLageApplication()))            ->removeContentType(new AllgemeineLageContentType())            ->removeContentType(new LatestAllgemeineLageContentType());        (new SchedulerSetup(new MeteoschweizAllgemeineLageApplication()))            ->removeScheduler(new AllgemeineLageScheduler());        (new ModelCollectionSetup())            ->removeCollection(new MeteoschweizAllgemeineLageModelCollection());    }}